import React from 'react';
import { styled } from 'styled-components';

function split() {
  return (
    <div>
      <FilterTimeSlide>
        <FilterTimeSlideInner
          rangeMinPercent={rangeMinPercent}
          rangeMaxPercent={rangeMaxPercent}
        />
      </FilterTimeSlide>
      <FilterPriceRangeWrap>
        <FilterPriceRangeMin type="range" />
        <FilterPriceRangeMax type="range" />
      </FilterPriceRangeWrap>
    </div>
  );
}

export default split;

const FilterTimeSlide = styled.div`
  position: relative;
  height: 4px;
  width: 650px;
  border-radius: 10px;
  background-color: #ddd;
`;

const FilterTimeSlideInner = styled.div`
  position: absolute;
  left: 30%;
  right: 30%;
  heigth: 4px;
  border-radius: 10px;
  background-color: #b0b0b0;
`;

const FilterPriceRangeWrap = styled.div`
  position: relative;
`;

const FilterPriceRangeMin = styled.input`
  position: absolute;
  top: -9px;
  width: 100%;
`;

const FilterPriceRangeMax = styled(FilterPriceRangeMin)``;
